<h1 class="font-heading text-4xl md:text-5xl">The Rarest Urbit Sigils</h1>
<p class="py-4">What makes an Urbit sigil rare?</p>
<h2 class="font-semibold text-3xl md:text-4xl mb-2 mt-8">Urbit Names</h2>
<p class="py-4">First let's take a brief look at Urbit names. &nbsp;All ships in the Urbit network are named using 3-letter syllables, and there are 512 syllables in total.</p>
<p class="py-4">These unique syllables are separated into two groups: 256 prefixes, and 256 suffixes.  &nbsp;The syllables are listed in full at the <a href="https://urbit.me/about/rarest-urbit-sigils#appendix">bottom of this article</a>.</p>
<p class="py-4">The names of the 256 galaxies in the urbit network are the same as the 256 suffixes:</p>
<span class="inline-flex items-center px-4 py-1 pr-6 mb-1"><span class="w-8 mx-4"><div><svg viewBox="0 0 32 32" version="1.1" xmlns="http://www.w3.org/2000/svg" class=""><rect fill="white" width="32px" height="32px" x="0px" y="0px"></rect><g transform="matrix(0.25,0,0,0.25,0,0)"><g fill="none" transform="matrix(1,0,0,1,0,0)"><path d="M64 128H0L5.59506e-06 0L64 5.59506e-06C99.3462 8.68512e-06 128 28.6538 128 64C128 99.3462 99.3462 128 64 128Z" fill="#1F2937" stroke="white" stroke-width="0.5800000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><line x1="96.5" y1="3.07317e-08" x2="96.5" y2="128" stroke="white" fill="none" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><line x1="32.5" y1="3.07317e-08" x2="32.5" y2="128" stroke="white" fill="none" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><circle cx="64" cy="64" r="11.5" fill="#1F2937" stroke="#1F2937" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><circle cx="64" cy="64" r="9" fill="white" stroke="white" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g></g></svg></div></span><span class="text-2xl sm:text-3xl font-medium ml-4">~dev</span></span>
<p class="py-4">Star names are made from just one word, a prefix followed by a suffix:</p>
<span class="inline-flex items-center px-4 py-1 pr-6 mb-1"><span class="w-16"><div><svg viewBox="0 0 64 32" version="1.1" xmlns="http://www.w3.org/2000/svg" class=""><rect fill="white" width="64px" height="64px" x="0px" y="0px"></rect><g transform="matrix(0.25,0,0,0.25,0,0)"><g fill="none" transform="matrix(1,0,0,1,0,0)"><path d="M128 0C57.3075 8.42999e-07 -8.42999e-07 57.3075 0 128H128V0Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><path d="M128 0C128 70.6924 70.6925 128 0 128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></path></g><g fill="none" transform="matrix(1,0,0,1,128,0)"><path d="M64 128H0L5.59506e-06 0L64 5.59506e-06C99.3462 8.68512e-06 128 28.6538 128 64C128 99.3462 99.3462 128 64 128Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><line x1="96.5" y1="3.07317e-08" x2="96.5" y2="128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><line x1="32.5" y1="3.07317e-08" x2="32.5" y2="128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><circle cx="64" cy="64" r="11.5" fill="#1F2937" stroke="#1F2937" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><circle cx="64" cy="64" r="9" fill="white" stroke="white" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g></g></svg></div></span><span class="text-2xl sm:text-3xl font-medium ml-4">~rondev</span></span>
<p class="py-4">Planet names are made up of two 6-letter words:</p>
<span class="inline-flex flex-col items-start sm:flex-row sm:items-center px-4 py-1 pr-6 mb-1"><span class="w-16"><div><svg viewBox="0 0 64 64" version="1.1" xmlns="http://www.w3.org/2000/svg" class=""><rect fill="white" width="64px" height="64px" x="0px" y="0px"></rect><g transform="matrix(0.25,0,0,0.25,0,0)"><g fill="none" transform="matrix(1,0,0,1,0,0)"><rect width="128" height="128" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></rect><path d="M32 0L32 128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><circle cx="32" cy="32" r="11.5" fill="#1F2937" stroke="#1F2937" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><circle cx="32" cy="32" r="9" fill="white" stroke="white" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g><g fill="none" transform="matrix(1,0,0,1,128,0)"><path d="M128 128C128 57.3076 70.6925 6.18013e-06 1.11901e-05 0L0 128L128 128Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><path d="M-3.8147e-06 128C-7.24633e-07 92.6538 28.6538 64 64 64C99.3462 64 128 92.6538 128 128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></path></g><g fill="none" transform="matrix(1,0,0,1,0,128)"><path d="M0 0C0 70.6925 57.3075 128 128 128V0H0Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><path d="M96 64C96 81.6731 81.6731 96 64 96" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><line x1="16.0035" y1="15.9965" x2="48.0035" y2="47.9965" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><circle cx="64" cy="64" r="16" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g><g fill="none" transform="matrix(1,0,0,1,128,128)"><circle cx="64" cy="64" r="64" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><line x1="16.0036" y1="15.9965" x2="48.0036" y2="47.9965" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line></g></g></svg></div></span><span class="text-2xl sm:text-3xl font-medium mt-2 sm:mt-0 sm:ml-4">~pinwyl-dirbet</span></span>
<p class="py-4">In this example <code class="bg-gray-100 py-px px-1 rounded-sm">pin</code> and <code class="bg-gray-100 py-px px-1 rounded-sm">dir</code> are prefixes, and <code class="bg-gray-100 py-px px-1 rounded-sm">wyl</code> and <code class="bg-gray-100 py-px px-1 rounded-sm">bet</code> are suffixes.</p>
<h2 class="font-semibold text-3xl md:text-4xl mb-2 mt-8">Point Numbers</h2>
<p class="py-4">Each of the 256 prefixes and 256 suffixes also have an 8-bit numerical value, ranging from 0-255.</p>
<p class="py-4">For example, both <code class="bg-gray-100 py-px px-1 rounded-sm">doz</code> and <code class="bg-gray-100 py-px px-1 rounded-sm">zod</code> have the value <code class="bg-gray-100 py-px px-1 rounded-sm">0</code>, but one is a prefix and one is a suffix.</p>
<p class="py-4">Hexadecimal numbers (beginning with <code class="bg-gray-100 py-px px-1 rounded-sm">0x</code>) are useful for reading point numbers, as you can view the data <span class="whitespace-nowrap">byte-by-byte</span>.</p>
<p class="py-4"><code class="bg-gray-100 py-px px-1 rounded-sm">dev</code> is a suffix with value <code class="bg-gray-100 py-px px-1 rounded-sm">179</code> or <code class="bg-gray-100 py-px px-1 rounded-sm">0xb3</code>, and the point number of galaxy <code class="bg-gray-100 py-px px-1 rounded-sm">~dev</code> is also <code class="bg-gray-100 py-px px-1 rounded-sm">179</code>.</p>
<span class="inline-flex flex-col sm:flex-row items-center px-4 py-1 pr-6 mb-1"><span class="w-8 mx-4"><div><svg viewBox="0 0 32 32" version="1.1" xmlns="http://www.w3.org/2000/svg" class=""><rect fill="white" width="32px" height="32px" x="0px" y="0px"></rect><g transform="matrix(0.25,0,0,0.25,0,0)"><g fill="none" transform="matrix(1,0,0,1,0,0)"><path d="M64 128H0L5.59506e-06 0L64 5.59506e-06C99.3462 8.68512e-06 128 28.6538 128 64C128 99.3462 99.3462 128 64 128Z" fill="#1F2937" stroke="white" stroke-width="0.5800000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><line x1="96.5" y1="3.07317e-08" x2="96.5" y2="128" stroke="white" fill="none" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><line x1="32.5" y1="3.07317e-08" x2="32.5" y2="128" stroke="white" fill="none" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><circle cx="64" cy="64" r="11.5" fill="#1F2937" stroke="#1F2937" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><circle cx="64" cy="64" r="9" fill="white" stroke="white" stroke-width="0.5800000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g></g></svg></div></span><span class="text-2xl sm:text-3xl font-medium mt-2 sm:mt-0 sm:ml-4">~dev</span><span class="text-2xl sm:text-3xl font-medium mt-2 sm:mt-0 sm:ml-4"><pre class="bg-gray-100 py-px px-1 rounded-sm inline"> 0x 00 00 00 b3 </pre></span></span>
<p class="py-4">The point number for a star is a 16-bit number where the suffix value is in the lower 8 bits, and the prefix value is in the upper 8 bits.</p>
<p class="py-4"><code class="bg-gray-100 py-px px-1 rounded-sm">ron</code> has the value <code class="bg-gray-100 py-px px-1 rounded-sm">0x60</code> and <code class="bg-gray-100 py-px px-1 rounded-sm">dev</code> has the value <code class="bg-gray-100 py-px px-1 rounded-sm">0xb3</code>, so the point number for <code class="bg-gray-100 py-px px-1 rounded-sm">~rondev</code> is <code class="bg-gray-100 py-px px-1 rounded-sm">0x60b3</code> or <code class="bg-gray-100 py-px px-1 rounded-sm">24,755</code> in decimal.</p>
<span class="inline-flex flex-col sm:flex-row items-center px-4 py-1 pr-6 mb-1"><span class="w-16"><div><svg viewBox="0 0 64 32" version="1.1" xmlns="http://www.w3.org/2000/svg" class=""><rect fill="white" width="64px" height="64px" x="0px" y="0px"></rect><g transform="matrix(0.25,0,0,0.25,0,0)"><g fill="none" transform="matrix(1,0,0,1,0,0)"><path d="M128 0C57.3075 8.42999e-07 -8.42999e-07 57.3075 0 128H128V0Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><path d="M128 0C128 70.6924 70.6925 128 0 128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></path></g><g fill="none" transform="matrix(1,0,0,1,128,0)"><path d="M64 128H0L5.59506e-06 0L64 5.59506e-06C99.3462 8.68512e-06 128 28.6538 128 64C128 99.3462 99.3462 128 64 128Z" fill="#1F2937" stroke="white" stroke-width="0.8300000000000001px" dataisgeon="true" stroke-linecap="square" vector-effect="non-scaling-stroke"></path><line x1="96.5" y1="3.07317e-08" x2="96.5" y2="128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><line x1="32.5" y1="3.07317e-08" x2="32.5" y2="128" stroke="white" fill="none" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></line><circle cx="64" cy="64" r="11.5" fill="#1F2937" stroke="#1F2937" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle><circle cx="64" cy="64" r="9" fill="white" stroke="white" stroke-width="0.8300000000000001px" stroke-linecap="square" vector-effect="non-scaling-stroke"></circle></g></g></svg></div></span><span class="text-2xl sm:text-3xl font-medium mt-2 sm:mt-0 sm:ml-4">~rondev</span><span class="text-2xl sm:text-3xl font-medium mt-2 sm:mt-0 sm:ml-4"><pre class="bg-gray-100 py-px px-1 rounded-sm inline"> 0x 00 00 60 b3 </pre></span></span>
<p class="py-4">Planets are represented by 32-bit numbers, but the syllables in the name do not match up with the bytes in the point number.</p>
