<p class="py-4">Planet names are obfuscated, so it's not obvious which star they come from.  This system effectively shuffles all the planet names and distributes them amongst all the stars.</p>
<p class="py-4">If they were not obfuscated, each star would have a very predicatable and boring list of planets:</p>
<div class="text-xl sm:text-2xl font-medium sm:mt-0 sm:ml-4">~doznec-rondev</div>
