<p class="py-4">When you use the <a href="https://urbit.me/search">Sigil search tool</a>, you can see all the glyphs are categorized into 12 general shapes.</p>
<p class="py-4">Even though all 512 glyphs have one of these 12 shapes, they are each unique due to other stylistic elements.</p>
